INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1804, 20843, 'Axitinib', 'Grapefruit juice may increase the plasma concentrations of axitinib.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruit.', 'grapefruit juice', 'Moderate', '', 'DDInter', 0, X'789c4d4edb0d83300c5ce50640ecd00dba82491c7045ec28715ad8be692524beee4ebad7935c58bdc12b9373c4477c031de2a2b2a06dd6f7087a9b4404d3d67371318525ac950aa7dac5a71bc7ab4be009a423a6275a2f65e73c367e79a751abebddcf87570a3e038f6b35d3898541310fd99cebf5cbea1fad3b92599cbfea084790', NULL, X'');
