INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1807, 24220, 'Pimozide', 'Theoretically, the coadministration with grapefruit juice may increase the plasma concentrations of pimozide.  The mechanism is decreased clearance of pimozide due to inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruits.', 'grapefruit juice', 'Major', '', 'DDInter', 0, X'789c4d8d410ec2300c04bfb247b8f42d1cf8801bbb8d5112478e5304afa7880bd7198de69e0595dadc28c57471b824ab551a0fd061cada76ec4e5d369f1a784c4d820b3546775b692daf3f3daee0e9df24b29cf485a74646d76a6f6559801b854a8b81916d160695615805c4870e6184fdb63047d17a1e93b5316b0fb506dbce2059b6b27c005c8e4539', NULL, X'');
