INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1863, 2934, 'Pirfenidone', 'Food significantly slows the rate but only modestly reduces the extent of absorption of pirfenidone.  In healthy, older adult volunteers aged 50 to 66 years, administration of a single 801 mg oral dose of pirfenidone in the fed state resulted in an approximately 50% reduction in peak plasma concentration (Cmax) and a 15% to 20% reduction in systemic exposure (AUC) compared to administration in the fasted state.  Median time to reach peak concentration (Tmax) increased from 0.5 hours to 3 hours with food.  Less nausea and dizziness were observed in fed subjects compared to fasted subjects.', 'grapefruit juice', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1864, 7009, 'Pirfenidone', 'Food significantly slows the rate but only modestly reduces the extent of absorption of pirfenidone.  In healthy, older adult volunteers aged 50 to 66 years, administration of a single 801 mg oral dose of pirfenidone in the fed state resulted in an approximately 50% reduction in peak plasma concentration (Cmax) and a 15% to 20% reduction in systemic exposure (AUC) compared to administration in the fasted state.  Median time to reach peak concentration (Tmax) increased from 0.5 hours to 3 hours with food.  Less nausea and dizziness were observed in fed subjects compared to fasted subjects.', 'grapefruit juice', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
