INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1883, 23820, 'Posaconazole', 'Food significantly increases the absorption of posaconazole from the oral suspension but only modestly from the delayed-release tablet.  Following single-dose administration, posaconazole mean peak plasma concentration (Cmax) and systemic exposure (AUC) are approximately 2.5 to 3 times higher when the oral suspension is given with a nonfat meal or a nutritional supplement (14 grams of fat) than when given under fasting conditions, and approximately 3.5 to 4 times higher when given during or 20 minutes after a high-fat meal (50 grams of fat) than under fasting conditions.  Acidic beverages may also increase posaconazole absorption.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1884, 23820, 'Posaconazole', 'Food significantly increases the absorption of posaconazole from the oral suspension but only modestly from the delayed-release tablet.  Following single-dose administration, posaconazole mean peak plasma concentration (Cmax) and systemic exposure (AUC) are approximately 2.5 to 3 times higher when the oral suspension is given with a nonfat meal or a nutritional supplement (14 grams of fat) than when given under fasting conditions, and approximately 3.5 to 4 times higher when given during or 20 minutes after a high-fat meal (50 grams of fat) than under fasting conditions.  Acidic beverages may also increase posaconazole absorption.', 'cola', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
